function initializeAutocomplete(){var t=document.getElementById("location"),n=new google.maps.places.Autocomplete(t);n.addListener("place_changed",function(){var i=n.getPlace(),u,r,t;if(!i.geometry){window.alert("No details available for input: '"+i.name+"'");return}for(u=i.address_components,r=0;t=u[r];r++){if(t.types[0]==="street_number"){document.getElementById("street-number").value=t.long_name;continue}if(t.types[0]==="route"){document.getElementById("street-name").value=t.short_name;continue}if(t.types[0]==="locality"){document.getElementById("city").value=t.long_name;continue}if(t.types[0]==="administrative_area_level_1"){document.getElementById("state").value=t.short_name;continue}if(t.types[0]==="postal_code"){document.getElementById("postal-code").value=t.long_name;continue}if(t.types[0]==="country"){document.getElementById("country").value=t.long_name;continue}}})}